/* eslint no-unused-vars: 0 */
import { html, svg, repeat, classMap, styleMap, ifDefined, unsafeHTML, scopeTag } from "@ui5/webcomponents-base/dist/renderer/LitRenderer.js";

const block0 = (context, tags, suffix) => html`<div id="${ifDefined(context._id)}" class="${ifDefined(context.stripClasses)}" tabindex="${ifDefined(context._tabIndex)}" role="tab" aria-posinset="${ifDefined(context._posinset)}" aria-setsize="${ifDefined(context._setsize)}" aria-controls="ui5-tc-contentItem-${ifDefined(context._posinset)}" aria-selected="${ifDefined(context.effectiveSelected)}" aria-disabled="${ifDefined(context.effectiveDisabled)}" ?disabled="${context.effectiveDisabled}" aria-labelledby="${ifDefined(context.ariaLabelledBy)}" data-ui5-stable="${ifDefined(context.stableDomRef)}">${ context.icon ? block1(context, tags, suffix) : undefined }<div class="ui5-tab-strip-itemContent">${ !context._isInline ? block2(context, tags, suffix) : undefined }${ context.text ? block4(context, tags, suffix) : undefined }</div></div> `;
const block1 = (context, tags, suffix) => html`<div class="ui5-tab-strip-item-icon-outer"><${scopeTag("ui5-icon", tags, suffix)} name="${ifDefined(context.icon)}" class="ui5-tab-strip-item-icon"></${scopeTag("ui5-icon", tags, suffix)}></div>`;
const block2 = (context, tags, suffix) => html`${ context.additionalText ? block3(context, tags, suffix) : undefined }`;
const block3 = (context, tags, suffix) => html`<span class="ui5-tab-strip-itemAdditionalText" id="${ifDefined(context._id)}-additionalText">${ifDefined(context.additionalText)}</span>`;
const block4 = (context, tags, suffix) => html`<span class="ui5-tab-strip-itemText" id="${ifDefined(context._id)}-text"><span class="${ifDefined(context.headerSemanticIconClasses)}"></span>${ifDefined(context.displayText)}</span>`;


export default block0;
